Фартух поліетиленовий одноразовий застосовується, головним чином, за своїм прямим призначенням - як надійний захист робочого одягу від вологи та різного роду забруднень, зазвичай, у поєднанні з одноразовими рукавичками. При цьому такі фартухи з поліетилену забезпечують:
гігієнічність;
зручність (прості у використанні, не сковують рухів);
легкість у догляді;
економічність - низька ціна самого фартуху та швидка заміна "робочої" частини одягу економить час, а також звільняє від частого прання, сушки та прасування самого робочого одягу (уніформи);
екологічність - не вимагають спеціальних вимог до утилізації, підлягають вторинній переробці.
Сфера використання одноразових поліетиленових фартухів досить-таки велика:
у промисловості і автосервісі - для короткочасного захисту одягу від бризок масла, бензину, фарби та інших виробничих забруднень;
в харчовій промисловості - в цілях дотримання вимог санітарно-гігієнічних норм при обробці, фасуванні харчових продуктів на птахофабриках, м'ясних, молочних комбінатах, в цехах виробництва напівфабрикатів, переробки риби, в кондитерських;
як одноразовий медичний фартух в лікувально-профілактичних закладах;
як фартух для перукаря - невід'ємний атрибут будь-якого майстра салону краси при фарбуванні або хімічній завивці волосся;
в господарстві і в побуті при ремонті або прибиранні приміщень.

Дезінфікуючий засіб для антисептичної обробки рук і шкіри і у всіх областях, швидкої дії, а також для дезінфекція інструментів багаторазового використання (манікюрних, педикюрних, насадок для фрезерів, перукарень інструментів та іншого інвентарю майстра).
Спосіб застосування:
- для гігієнічної обробки рук нанести 3 мл засобу на шкіру і витримати 15 секунд;
- для дезінфекції шкіри клієнта повністю зволожити її даними засобом і витримати 15 секунд;
- для профілактики грибкових інфекцій ніг нанести 3 мл засобу на шкіру стоп і витримати 15 секунд;
- для швидкої дезінфекції поверхонь та інструментів необхідно використовувати засіб з розрахунку 30 мл на 1 кв. м. Час дії 15 секунд.
